if (typeof lastNumber === 'undefined') {
  // If we are here, lastNumber didn't exist, so we initialize it.
  // We explicitly declare it on the global scope (using 'var' or 'this') 
  // so it persists for the next eval.
  lastNumber = 300; 
}

function process(value) {
  if (lastNumber < 200){lastNumber = 200}
  const variation = 150;
  let min = lastNumber - variation;
  let max = lastNumber + variation;
    // 3. Clamp to global limits (0 to 20000)
  if (min < 500) min = 500
  if (max > 800) max = 800;
  if (min>max) {min = max}
  // 4. Generate random number within the specific range
  // Math.random() generates 0 (inclusive) to 1 (exclusive)
  lastNumber = Math.random() * (max - min) + min;
  return lastNumber;
}
